sys_data_source.data_loader:
(function loadData(import_set_table) {

    var maxRow = import_set_table.getMaximumRows();
    if (maxRow > -1) {
        gs.info('SG-Enosix: Test Loading a limited number of records max row count of ' + maxRow);
    }
    new enosixFunctionalLocationImportController().beginImport(import_set_table, '15db800c2f320110a8ce2b5df699b63b', 'enosix', maxRow);

})(import_set_table);
